#include <fstream>

using namespace std;

int main() {
  ifstream fin("ucif.in");
  ofstream fout("ucif.out");
  int n;
  fin >> n;
  int s = 0;
  for (int i = 1; i <= n; i++) {
    int p = 1;
    for (int j = 1; j <= i; j++) {
      p *= i;
    }
    s += p;
  }
  fout << s % 10 << endl;
  return 0;
}
